const statusCodes = {
	ok: 200,
	created: 201,
	noContent: 204,
	redirect: 301,
	badRequest: 400,
	unauthorized: 401,
	forbidden: 403,
	notFound: 404,
	internalServerErr: 500
};

module.exports = statusCodes;
